<h3 class="articletitle">Lfeu</h3>
Lfeu is a rough triangular red crystal. Lfeu's properties are entirly mundane and is uniquly useful in the construction of watercraft. Lfeu was first discovered by the inventor <a href="../people/EllieWudushqmkqbu0c2u.html">Ellie Wudush</a> within the <a href="../localregions/G̈ogë-taqëMaquis.html">G̈ogë-taqë Maquis</a> durring the late 12th century in spring of the year 1183.
